import React from "react";


const Security = ()=>{
    return(
        <div className="security-section-container">
            <div className="upload-inputs-container show-warnings">
                    <h2>Password Required</h2>
                    <label>For Security Reasons you have to type the correct password set by the author of this perticular photo to access or download the image.</label>
                    <input className="input-primary" type="password" placeholder="Type Password"></input>
                    <p className="warning-message">by default it is set to Anonymous.</p>

                    <button className="hero-btn">Access Photo</button>
            </div>
        </div>
    );
};


export default Security;
